import React from 'react';
import { Card, Icon, Label } from 'semantic-ui-react';

const PostCard = ({ info }) => {
  const {
    id,
    username,
    body,
    createdAt,
    likeCount,
    commentCount,
    likes
  } = info;

}

export default PostCard;
